import React, { useState, useEffect } from 'react';
import MyNavbar from '../src/components1/shared/MyNavbar';
import Footer from '../src/components1/shared/Footer.jsx';
import "reactstrap/lib/";
import "bootstrap/dist/css/bootstrap.min.css";
// import Navbar from "react-bootstrap/Navbar";
// import { Nav } from "react-bootstrap";
import "./styles.css";
import LandingPage from "./pages/LandingPage";
import SignUp1 from "./pages/SignUp1";
import User2 from "./pages/User2";
import User3 from "./pages/User3";
import Company1 from "./pages/Company1";
import Company2 from "./pages/Company2";
import Company3 from "./pages/Company3";
import User1 from "./pages/User1";
import SignUpPage from "./pages/SignUpPage";
import LoginPage from "./pages/LoginPage";
import LogoutButton from "./pages/Logout";
import LoginStatus from "./pages/LoginStatus";
import MainPage from "./pages/MainPage";
import ExpensesPage from "./pages/ExpensesPage";
import RecordsPage from "./pages/RecordsPage";
import { useSlashAuth } from '@slashauth/slashauth-react';

import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  withRouter,
  BrowserRouter
} from "react-router-dom";
import { TransactionProvider } from "../src/context/TransactionContext";



const App = () => {
  const { isAuthenticated } = useSlashAuth();
    return (
      <> 
      <BrowserRouter>
       <MyNavbar />
         <Switch>
         <Route path="/" exact component={LandingPage} />
         <TransactionProvider>
         <Route path="/signup1" component={SignUp1} />
         <Route path="/company1" component={Company1} />
         <Route path="/company2" component={Company2} />
         <Route path="/company3" component={Company3} />
        <div>
        {isAuthenticated ?  <LogoutButton/> : <LoginPage/>}
      <LoginStatus  />
        </div>
      
         <Route path="/user1" component={User1} />
         <Route path="/user2" component={User2} />
         <Route path="/user3" component={User3} />
       
          <Route path="/signup" component={SignUpPage} />
           <Route  path="/main" component={MainPage} />
           <Route path="/expenses" component={ExpensesPage} /> 
          
           <Route path="/records" component={RecordsPage} />
           </TransactionProvider>  
         </Switch>
       
         <Footer/>
       </BrowserRouter>
    
     </>
    );
  };

export default App;
